    false,nt"url": null,nt"notes": "This report summarizes the results from
    macroinvertebrate and diatom surveys conducted in Desper, Gardiner, and Scottie
    creeks; lowland streams in Tetlin National Wildlife Refuge, interior Alaska. These
    three streams were sampled repeatedly during the summers of 2007 through 2010. The
    objectives of this study were to characterize the stream biological communities
    for streams in the Tetlin Refuge where data currently does not exist. Sites were
    sampled over several years in order to describe inter-annual changes in community
    composition.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
